,BF3_ID_P_VNAME_PHOENIX:"PHOENIX",BF3_ID_P_VNAME_QUADBIKE:"QUAD",BF3_ID_P_VNAME_RHINO:"RHINO",BF3_ID_P_VNAME_RIB:"RHIB BOAT",BF3_ID_P_VNAME_SU35:"SU-35BM FLANKER-E",BF3_ID_P_VNAME_SU39:"SU-25TM FROGFOOT",BF3_ID_P_VNAME_T90:"T-90A",BF3_ID_P_VNAME_TOW:"M220 TOW LAUNCHER",BF3_ID_P_VNAME_UH1Y:"UH-1Y VENOM",BF3_ID_P_VNAME_VDV:"VDV BUGGY",BF3_ID_P_VNAME_VODAA:"VODNIK AA",BF3_ID_P_VNAME_VODNIK:"GAZ-3937 VODNIK",BF3_ID_P_VNAME_Z11:"Z-11W",BF3_ID_P_VUDESC_AAAA:"Lanciamissili antiaerei sono montati sulla torretta in grado di agganciare e inseguire i velivoli nemici.",BF3_ID_P_VUDESC_AAARADAR:"La portata della minimappa aumenta considerevolmente e rivela tutti i velivoli alleati e nemici.",BF3_ID_P_VUDESC_AAARMOR:"Pannelli corazzati reattivi e stabilizzatori che assorbono l'impatto di attacchi da armi anticarro, proteggendoti, ma distruggendosi nel frattempo.",BF3_ID_P_VUDESC_AAENVG:s,BF3_ID_P_VUDESC_AAPREVENT:f,BF3_ID_P_VUDESC_AAPROX:y,BF3_ID_P_VUDESC_AASMOKE:"Granate fumogene potenziate con filamenti metallici, che esplodendo, eliminano i designatori laser, ingannano i missili guidati e impediscono ai nemici di rivelare la tua posizione ai loro compagni.",BF3_ID_P_VUDESC_AASTEALTH:"Copertura anti-riflesso sul veicolo che rende più difficile l'agganciamento e tracciamento da parte dei nemici e aumenta il tempo per essere avvistato.",BF3_ID_P_VUDESC_AAWPNEFF:t,BF3_ID_P_VUDESC_AAZOOM:v,BF3_ID_P_VUDESC_AHAA:"Missili a ricerca di calore lanciati dal pilota, che si agganciano ai velivoli nemici.",BF3_ID_P_VUDESC_AHARADAR:h,BF3_ID_P_VUDESC_AHBRADAR:"Volando a bassa quota la tua traccia termica diminuisce, celandoti ai radar nemici e impedendo ai sistemi di missili aria-aria di agganciarti.",BF3_ID_P_VUDESC_AHECM:"Contromisure elettroniche come lanciagranate chaff e trasmettitori di disturbo bloccano per alcuni istanti i sistemi di puntamento dei missili nemici, una volta attivati.",BF3_ID_P_VUDESC_AHENVG:"Mirino per arma secondaria per il cannoniere con visuale termica, che illumina i soldati e i veicoli per una chiara identificazione dei bersagli.",BF3_ID_P_VUDESC_AHFIREEX:"Il rilascio controllato di aria compressa nel compartimento motore può estinguere eventuali incendi, consentendo a un velivolo in avaria di riprendere a operare normalmente, superando il danno.",BF3_ID_P_VUDESC_AHFLARE:u,BF3_ID_P_VUDESC_AHGHELL:"Missili guidati lanciati dal cannoniere dell'elicottero che agganciano e seguono i veicoli di terra nemici e possono acquisire bersagli tramite puntamento laser, anche fuori dal campo visivo.",BF3_ID_P_VUDESC_AHGUIDE:"I razzi del pilota sono equipaggiati di sistemi di guida semi-attivi, che aumentano la loro precisione e la loro portata.",BF3_ID_P_VUDESC_AHLASER:"Sistema di puntamento installato nel radome, acquisisce automaticamente qualsiasi mezzo nemico rientri nel campo visivo, designandolo come bersaglio per gli alleati dotati di armi a guida laser.",BF3_ID_P_VUDESC_AHPREV:f,BF3_ID_P_VUDESC_AHPROX:y,BF3_ID_P_VUDESC_AHSTEALTH:i,BF3_ID_P_VUDESC_AHTVG:"Missili teleguidati lanciati dal cannoniere dell'elicottero che vengono controllati in tempo reale.",BF3_ID_P_VUDESC_AHWPNEFF:t,BF3_ID_P_VUDESC_AHZOOM:"Mirino per arma secondaria per il cannoniere con ingrandimento fino a 3x.",BF3_ID_P_VUDESC_ARTAA:"Vengono aggiunte capacità missilistiche antiaeree, con aggancio e inseguimento dei velivoli nemici.",BF3_ID_P_VUDESC_ARTAIRBURST:"Vengono aggiunti missili airburst, che esplodono in aria sopra il terreno per infliggere il massimo dei danni alla fanteria.",BF3_ID_P_VUDESC_ARTDEFENSE:"Lancia delle schegge intorno al veicolo, infliggendo danni ai giocatori nelle vicinanze.",BF3_ID_P_VUDESC_ARTPREVENT:n,BF3_ID_P_VUDESC_ARTPROX:r,BF3_ID_P_VUDESC_ARTSMOKE:"Granate fumogene potenziate con filamenti metallici, che, esplodendo, eliminano i designatori laser, ingannano i missili guidati e impediscono ai nemici di rivelare la tua posizione ai loro compagni.",BF3_ID_P_VUDESC_ARTSTEALTH:"Copertura anti-riflesso sul veicolo che rende più difficile l'agganciamento e il tracciamento da parte dei nemici e aumenta il tempo necessario prima che il nemico riesca a scoprirti. Sempre attiva quando a bordo di un veicolo.",BF3_ID_P_VUDESC_ARTTOW:"Missile anticarro filoguidato e a puntamento ottico.",BF3_ID_P_VUDESC_ARTWPNEFF:t,BF3_ID_P_VUDESC_ARTZOOM:v,BF3_ID_P_VUDESC_IFVAPFSDS:"Proiettile perforante stabilizzato da alette ad abbandono d'involucro (con tracciante) che provoca danni più diretti ma senza elementi esplosivi.",BF3_ID_P_VUDESC_IFVARMOR:m,BF3_ID_P_VUDESC_IFVAT:"Lanciamissili anticarro filoguidati sono montati sulla torretta.",BF3_ID_P_VUDESC_IFVCOAX:"Una leggera mitragliatrice è montata coassialmente sulla tua arma primaria.",BF3_ID_P_VUDESC_IFVENVG:s,BF3_ID_P_VUDESC_IFVHELL:"Lanciamissili anticarro a puntamento laser sono montati sulla torretta che aggancia i veicoli di terra nemici e possono acquisire bersagli designati tramite puntamento laser, anche al di fuori del campo visivo.",BF3_ID_P_VUDESC_IFVPREVENT:n,BF3_ID_P_VUDESC_IFVPROX:r,BF3_ID_P_VUDESC_IFVSMOKE:c,BF3_ID_P_VUDESC_IFVSTEALTH:a,BF3_ID_P_VUDESC_IFVWPNEFF:t,BF3_ID_P_VUDESC_IFVZOOM:v,BF3_ID_P_VUDESC_JETAA:E,BF3_ID_P_VUDESC_JETARADAR:h,BF3_ID_P_VUDESC_JETAVIONIC:"Un potenziamento computerizzato che ti aiuterà ad agganciare i bersagli nemici più velocemente se abbinato a missili a ricerca di calore o a puntamento laser.",BF3_ID_P_VUDESC_JETBRADAR:g,BF3_ID_P_VUDESC_JETECM:d,BF3_ID_P_VUDESC_JETEROCKET:"Un set di razzi non guidati FFAR sotto le ali.",BF3_ID_P_VUDESC_JETFLARE:u,BF3_ID_P_VUDESC_JETMAVER:p,BF3_ID_P_VUDESC_JETPREV:f,BF3_ID_P_VUDESC_JETPROX:y,BF3_ID_P_VUDESC_JETSTEALTH:i,BF3_ID_P_VUDESC_JETWPNEFF:t,BF3_ID_P_VUDESC_LBTFIREEX:"Riporta un veicolo in avaria a operare normalmente.",BF3_ID_P_VUDESC_MBTARMOR:m,BF3_ID_P_VUDESC_MBTATGM:"Un proiettile STAFF in grado di agganciare i veicoli di terra nemici e di acquisire bersagli designati tramite puntamento laser, anche al di fuori del campo visivo.",BF3_ID_P_VUDESC_MBTCANISTER:"Un proiettile per carro armato che racchiude migliaia di sfere in tungsteno sparato dal cannone frontale come un fucile a pompa.",BF3_ID_P_VUDESC_MBTCITV:"Accesso a una terza torretta sul carro disponibile. Da qui è possibile designare i bersagli tramite puntamento laser e utilizzare un rilevatore di prossimità. Puoi montare sul carro in questa posizione, anche se altri giocatori stanno occupando le postazioni del pilota e del cannoniere.",BF3_ID_P_VUDESC_MBTCOAX:"Una leggera mitragliatrice è montata coassialmente alla tua arma primaria.",BF3_ID_P_VUDESC_MBTENVG:s,BF3_ID_P_VUDESC_MBTHMG:"Una pesante mitragliatrice è montata coassialmente sulla tua arma primaria.",BF3_ID_P_VUDESC_MBTPREVENT:n,BF3_ID_P_VUDESC_MBTPROX:r,BF3_ID_P_VUDESC_MBTSMOKE:c,BF3_ID_P_VUDESC_MBTSTEALTH:a,BF3_ID_P_VUDESC_MBTWPNEFF:t,BF3_ID_P_VUDESC_MBTZOOM:v,BF3_ID_P_VUDESC_SHAA:E,BF3_ID_P_VUDESC_SHARADAR:h,BF3_ID_P_VUDESC_SHBRADAR:g,BF3_ID_P_VUDESC_SHECM:d,BF3_ID_P_VUDESC_SHFIREEX:"Il rilascio controllato di aria compressa nel compartimento motore può estinguere eventuali incendi, cosa che consente a un velivolo in avaria di riprendere a operare normalmente, superando il danno.",BF3_ID_P_VUDESC_SHFLARE:u,BF3_ID_P_VUDESC_SHHELL:p,BF3_ID_P_VUDESC_SHPREV:n,BF3_ID_P_VUDESC_SHPROX:r,BF3_ID_P_VUDESC_SHSTEALTH:i,BF3_ID_P_VUDESC_SHWPNEFF:t,BF3_ID_P_VUNAME_AAAA:Yt,BF3_ID_P_VUNAME_AAARADAR:G,BF3_ID_P_VUNAME_AAARMOR:rt,BF3_ID_P_VUNAME_AAENVG:"VISUALE TERMICA",BF3_ID_P_VUNAME_AAPREVENT:S,BF3_ID_P_VUNAME_AAPROX:b,BF3_ID_P_VUNAME_AASMOKE:nt,BF3_ID_P_VUNAME_AASTEALTH:T,BF3_ID_P_VUNAME_AAWPNEFF:F,BF3_ID_P_VUNAME_AAZOOM:I,BF3_ID_P_VUNAME_AHAA:O,BF3_ID_P_VUNAME_AHARADAR:G,BF3_ID_P_VUNAME_AHBRADAR:W,BF3_ID_P_VUNAME_AHECM:it,BF3_ID_P_VUNAME_AHENVG:wt,BF3_ID_P_VUNAME_AHFIREEX:Jt,BF3_ID_P_VUNAME_AHFLARE:en,BF3_ID_P_VUNAME_AHGHELL:j,BF3_ID_P_VUNAME_AHGUIDE:"RAZZO GUIDATO",BF3_ID_P_VUNAME_AHLASER:"ILLUMINATORE LASER",BF3_ID_P_VUNAME_AHPREV:S,BF3_ID_P_VUNAME_AHPROX:b,BF3_ID_P_VUNAME_AHSTEALTH:rn,BF3_ID_P_VUNAME_AHTVG:"MISSILE TELEGUIDATO",BF3_